@kathyireland presented me with Entrepreneur of the Year for my work with my brand @inamoratawoman this week. For those of you who don‚Äôt know, Kathy started her business 26 years ago and has built a billion dollar company that continues to grow exponentially every year. 
I sat next to Kathy and tried to soak up all the wisdom and good juju that I possibly could and she said a couple amazing things, one being that it can be a blessing to be underestimated. 
Starting a business as a woman and a woman who has been thought of as nothing more than a sex symbol and fashion model can be challenging and overwhelming. It is so inspiring to see how Kathy has turned any preconceptions on their head. Thank you for your support of me and @inamoratawoman as we continue to grow!
